import React from "react";

import "./order-details.styles.scss";

const OrderDetails = ({ location, city, country, zip, name, price }) => (
  <div className="order-details">
    <div>{name}</div>
    <div className="address">
      <span>{location}</span>
      <span>{city}</span>
      <span>{country}</span>
      <span>{zip}</span>
    </div>
    <span>{price}</span>
  </div>
);

export default OrderDetails;
